package db.domain;public class UserGpsImpl implements UserGps , 
				UserItem
			{	@Key	private String uname;	private int longitude;	private int latitude;	public UserGpsImpl() {	}	public UserGpsImpl(UserGps c) {		this.uname = c.getUname();		this.longitude = c.getLongitude();		this.latitude = c.getLatitude();	}	@Override	public String tableName() {		return "user_gps";	}	public void setUname(String uname) {		this.uname = uname;	}	public String getUname() {		return this.uname;	}public void addUname(String uname) {		this.uname += uname;}	public void setLongitude(int longitude) {		this.longitude = longitude;	}	public int getLongitude() {		return this.longitude;	}public void addLongitude(int longitude) {		this.longitude += longitude;}	public void setLatitude(int latitude) {		this.latitude = latitude;	}	public int getLatitude() {		return this.latitude;	}public void addLatitude(int latitude) {		this.latitude += latitude;}}